{"reasoning":"Ground-truth bug: the NPC remains in its default T/A-pose, does not play any locomotion animation, slides/floats when it should be walking (especially up stairs). Key characteristics: permanently frozen in one pose, legs not animated, sliding movement.

Generated report: the NPC ‘rapidly shifts between different poses’, creating a jittering/dancing effect during a dialogue scene. It is not stuck in a single T- or A-pose, nor does it describe sliding movement or leg inactivity; instead it describes continuous pose changes while the dialogue marker is active.

Because the symptoms (frozen T-pose and sliding locomotion vs. jittering pose changes during dialogue) and the context (general movement vs. dialogue interaction) are different, the two reports refer to different underlying bugs.","match":false}

{"reasoning":"Ground truth bug concerns two NPCs initially occupying exactly the same coordinates (overlapping). When the player attacks one, both NPCs separate. Key elements: overlapping NPCs, separation after attack.

Generated report talks about a single character model having erratic animation transitions, clipping through vegetation, outline rendering artifacts in sugarcane field combat. It does not mention multiple NPCs overlapping or separating after being hit. The issue is about animation/visual artifacts with environment collisions, not NPC stacking.

Therefore, the generated report does not describe the same underlying bug.","match":false}

{"reasoning":"Ground truth emphasizes a skeletal/rigging deformation: legs positioned beside arms, bent upward, clipping into torso – characters look physically distorted but otherwise mostly static (one stands, other walks).

Generated report talks about a different symptom: the character remains normally modeled ("maintains a standing pose") but spins/rotates in place with wrong transition animations. No mention of limb misplacement, clipping into torso, or body deformation. Likewise, ground truth says nothing about continuous spinning or rotation glitches.

Because the core issues (body deformation vs. rotation/animation glitch) and the observed behaviors differ, they are not describing the same bug.","match":false}

{"reasoning":"The ground-truth bug is specifically about what happens when TWO characters occupy the same driver’s seat: the player gets in while an NPC is already there, their bodies overlap, the camera clips, and only pieces of the head (mouth, neck, back of head) are visible.  

The generated report describes the visual result – a floating/disembodied head with mouth textures visible in the vehicle interior – which is the same visual symptom noted in the ground truth.  However, it never mentions the trigger condition of a second NPC already sitting in the driver’s seat. It talks only about viewing the character "while seated in the driver’s seat" and certain camera angles.  

Because the unique condition that distinguishes this bug (simultaneous occupancy/player entering an already-occupied seat) is absent from the generated report, we cannot be sure it is describing the same underlying issue; the symptom could stem from a general first-person camera clipping problem.  Thus the two descriptions are not guaranteed to be the same bug.","match":false}

{"reasoning":"Ground truth describes what looks like a rag-doll/ corpse lying horizontally and hovering above the bar, intersecting the counter and another (seated) NPC. The key points are: (1) the body is horizontal and floating over the bar, and (2) it overlaps both the counter and a seated NPC.

The generated report instead talks about an NPC that is still considered seated on a barstool, but whose torso is bent sharply backwards. It mentions clipping through the furniture but does not describe the character floating horizontally above the counter or intersecting a second NPC. The posture (“bent backwards while seated”) is different from “lying horizontally and floating.”

Although both relate to animation/physics glitches at a bar counter, the concrete symptom and visual result differ, indicating they are different bugs.","match":false}

{"reasoning":"Ground truth describes a character that moves smoothly across the ground without playing the walk/run animation – i.e., the character is “sliding” or “gliding.”

The generated report instead talks about an NPC that pops into view and then moves with skipped frames, producing a “teleporting” or jerky, discontinuous motion. This focuses on animation frames being skipped and sudden position changes, not on the character gliding smoothly without leg motion.

Because the symptom (continuous slide vs. discontinuous teleportation) and visual result are different, the two reports do not describe the same underlying bug.","match":false}

{"reasoning":"Ground-truth bug: while a wrestler lies on the mat, their own hand penetrates their own torso and the whole body jitters rapidly. Key points: (a) self-clipping (hand into own body), (b) rapid shaking.

Generated report: during a submission hold the defender’s body sinks through the ring mat and the attacker’s model; it describes general collision failure with other objects. It does not mention the wrestler’s hand penetrating their own body nor any rapid shaking. Instead it focuses on inter-model/mat clipping.

Although both involve clipping during a ground animation, the concrete symptom set is different: self-clipping & jitter vs inter-model/mat clipping without jitter. These are likely distinct animation/collision bugs, so the reports do not describe the same underlying issue.","match":false}

{"reasoning":"Ground-truth bug occurs in a scripted animation: the truck drives into a wall, then in the following cut-scene hovers above the ground while passing INTO a building and clips through its geometry. Key elements are: scripted animation, truck becomes airborne for the whole body (not just front wheels), and clipping through the building interior.

Generated report concerns normal gameplay on a set of stairs. The truck stops and balances with its FRONT wheels in the air; no mention of a cut-scene, of driving into/through a building, or of clipping through walls. Environment, trigger conditions, and visible result (balanced on stairs vs moving through building) differ.

Although both describe unrealistic physics/hovering behavior, the circumstances and manifestation are distinct, indicating different underlying issues. Therefore they should not be considered the same bug.","match":false}

{"reasoning":"Ground truth bug is about a carriage that suddenly spawns (pop-in) in front of a player who is riding a horse, immediately causing a collision that throws the rider off. The core issue is unexpected carriage appearance/spawning leading to a forced collision.

Generated report talks about the player already riding a horse-drawn carriage; the bug is a collision-detection failure where the character clips through the carriage geometry. There is no mention of sudden spawning/pop-in, no rider on horseback, and the main problem is faulty collision physics/clipping, not an unexpected spawn collision.

Since the scenarios, triggers, and symptoms differ (pop-in collision vs. clipping inside existing carriage), they describe different underlying bugs.","match":false}

{"reasoning":"Ground truth bug concerns a very specific model-swap/transformation error: when a boy climbs into a red robotic armor, the character is replaced by a large, naked, headless human model. The distinctive symptoms are (1) wrong model (large naked, headless human), (2) happens at the moment the boy enters the armor.

Generated report talks about an NPC whose body "stretches and twists" with physics/animation distortions during combat while being shot. It cites limb elongation and rigging issues, not a model swap to a different, headless, naked body, and the trigger is combat, not entering armor.

Because the core conditions and visual results differ, these two reports describe different bugs.","match":false}
